import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" {...props}><path fill="#e8aab8" d="M0 0h24v24H0z" /><path fill="none" stroke="#fff" strokeMiterlimit={10} d="M12 4v16M4.5 6.5h5v5h-5zM4.5 13.5h5v4h-5zM14.5 6.5h5v5h-5zM14.5 13.5h5v4h-5z" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <rect width="24" height="24" fill="#e8aab8"/>  <line x1="12" y1="4" x2="12" y2="20" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <rect x="4.5" y="6.5" width="5" height="5" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <rect x="4.5" y="13.5" width="5" height="4" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <rect x="14.5" y="6.5" width="5" height="5" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <rect x="14.5" y="13.5" width="5" height="4" fill="none" stroke="#fff" stroke-miterlimit="10"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
